import React from 'react'
import "./home.css"

const Home = () => {
  return (
    <>
      <div className="container">
        <h2>Log in here</h2>
        <input placeholder='Enter your Email'/>
        <input type="submit" value="send" />
      </div>
      </>
  )
}

export default Home;
